import * as React from 'react';
import { useServerGoods } from './useServerGoods';
import Good from './Good';

function GoodsPage() {
    const { goods, loadMoreGoods } = useServerGoods();

    return (
        <div>
            <h1>Goods</h1>
            <div>
                {goods.map((good) => (
                    <Good key={good.id} post={good} />
                ))}
            </div>
            <button onClick={loadMoreGoods}>Show more</button>
        </div>
    );
}

export default GoodsPage;
